from dataclasses import dataclass

@dataclass
class Triple:
    subject: str
    predicate: str
    object: str

# EVOLVE-BLOCK-START

def predict(triples: list[Triple]) -> str:
    sentence = ""
    for i, triple in enumerate(triples):
        if i == 0:
            sentence += f"{triple.subject}"

        if triple.predicate == "league":
            sentence += f" plays in the {triple.object}"
        elif triple.predicate == "manager":
            sentence += f" is managed by {triple.object}"
        elif triple.predicate == "position":
            sentence += f" plays as a {triple.object}"
        elif triple.predicate == "ground":
            sentence += f" plays at {triple.object}"
        elif triple.predicate == "birthDate":
            sentence += f" was born on {triple.object}"
        elif triple.predicate == "birthPlace":
            sentence += f" was born in {triple.object}"
        elif triple.predicate == "birthYear":
            sentence += f" was born in {triple.object}"
        elif triple.predicate == "club":
            sentence += f" plays for {triple.object}"
        elif triple.predicate == "currentclub":
            sentence += f" currently plays for {triple.object}"
        elif triple.predicate == "country":
            sentence += f" is from {triple.object}"
        else:
            sentence += f" {triple.predicate} is {triple.object}"

    return sentence + "."

